import { View, Panel } from '@vkontakte/vkui';

function formatName(user) {
	return user.firstName + ' ' + user.lastName;
  }
  
  const user = {
	firstName: 'Марья',
	lastName: 'Моревна'
  };
  
  const element = (
	<h1>
	  Здравствуй, {formatName(user)}!
	</h1>
  );
  
  export default fromatname;
  ReactDOM.render(
	element,
	document.getElementById('root')
  );
